import React from "react";
import { TextField } from "@material-ui/core/";

import { FieldTitle } from "../../../atoms";
import Icons from "../../../../resources/icons";
import "./index.scss";

export const RegisterSix = ({ user, onUserChange }) => {
  return (
    <div id="back-information-form">
      <FieldTitle icon={Icons.email} label="Banco" />
      <TextField
        className="field"
        variant="outlined"
        margin="normal"
        label="Banco"
        name="bankName"
        value={user.bankName}
        onChange={onUserChange}
        inputProps={{ tabIndex: "1" }}
      />
      <FieldTitle icon={Icons.strongbox} label="Número de cuenta bancaria" />
      <TextField
        className="field"
        variant="outlined"
        margin="normal"
        label="Número de cuenta bancaria"
        name="bankAccount"
        value={user.bankAccount}
        onChange={onUserChange}
        inputProps={{ tabIndex: "2" }}
      />
      <FieldTitle icon={Icons.hashtag} label="Swift" />
      <TextField
        className="field"
        variant="outlined"
        margin="normal"
        label="Swift"
        name="swift"
        value={user.swift}
        onChange={onUserChange}
        inputProps={{ tabIndex: "3" }}
      />
    </div>
  );
};
